import { useState } from "react";

import {
  Navbar,
  Space,
  Divider,
  Button,
  Avatar,
  FileButton,
  Title,
  Flex,
  Container,
  AppShell,
  SimpleGrid,
  TextInput,
  Tooltip,
  UnstyledButton,
} from "@mantine/core";
import { IconUser, IconKey, IconBell, IconLogout } from "@tabler/icons-react";
import Footer from "../components/Footer";
import NavBar from "./settings/NavBar";
import Account from "./settings/Account";

const Password = () => {};
const Notifications = () => {};

const data = [
  {
    label: "Account",
    icon: <IconUser stroke={1.5} />,
    element: <Account />,
  },
  {
    label: "Password",
    icon: <IconKey stroke={1.5} />,
    element: <Password />,
  },
  {
    label: "Notifications",
    icon: <IconBell stroke={1.5} />,
    element: <Notifications />,
  },
];

const labels = data.map((item) => {
  return { label: item.label, icon: item.icon };
});

const AccountPage = () => {
  const [active, setActive] = useState(0);

  return (
    <AppShell
      navbar={<NavBar active={active} setActive={setActive} data={data} />}
      footer={<Footer />}
    >
      <Account />
    </AppShell>
  );
};

export default AccountPage;
